import React from 'react';
import { Container, Row, Col, Card, ListGroup, Button } from 'react-bootstrap';
import './AboutUs.css'; 
const AboutUs = () => {
  return (
    <div>
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-content">
          <h1>About HDSI Foundation</h1>
          <p>
            Learn more about the mission, vision, and values that drive us to create a positive
            impact in the world.
          </p>
          <Button variant="primary" href="#mission-section">Explore Our Work</Button>
        </div>
      </section>

      {/* Who We Are Section */}
      <section id="mission-section" className="about-section">
        <Container>
          <Row>
            <Col md={12}>
              <Card>
                <Card.Body>
                  <Card.Title>Who We Are</Card.Title>
                  <Card.Text>
                    The HDSI Foundation is a non-profit organization committed to promoting education,
                    innovation, and community welfare. With a mission to empower underprivileged
                    communities and enable the development of skilled professionals, we focus on providing
                    sustainable solutions in various sectors like education, healthcare, and technology.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          </Row>

          {/* Mission & Vision Section */}
          <Row className="mt-4">
            <Col md={6}>
              <Card>
                <Card.Body>
                  <Card.Title>Our Mission</Card.Title>
                  <Card.Text>
                    The mission of HDSI Foundation is to drive positive change in the lives of the people
                    in the communities we serve, particularly in underserved regions. Through education,
                    technology, and healthcare initiatives, we aim to build a future where everyone has equal
                    opportunities for growth and success.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>

            <Col md={6}>
              <Card>
                <Card.Body>
                  <Card.Title>Our Vision</Card.Title>
                  <Card.Text>
                    Our vision is to create a world where innovation and knowledge contribute to transforming
                    lives and society. We strive to lead with compassion, integrity, and accountability, ensuring
                    our initiatives have a lasting and meaningful impact.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          </Row>

          {/* Our Values Section */}
          <Row className="mt-4">
            <Col md={12}>
              <Card>
                <Card.Body>
                  <Card.Title>Our Values</Card.Title>
                  <ListGroup variant="flush">
                    <ListGroup.Item>Integrity and Transparency</ListGroup.Item>
                    <ListGroup.Item>Commitment to Education</ListGroup.Item>
                    <ListGroup.Item>Innovation for Good</ListGroup.Item>
                    <ListGroup.Item>Empathy and Inclusion</ListGroup.Item>
                    <ListGroup.Item>Community Collaboration</ListGroup.Item>
                  </ListGroup>
                </Card.Body>
              </Card>
            </Col>
          </Row>

          {/* Our Impact Section */}
          <Row className="mt-4">
            <Col md={12}>
              <Card>
                <Card.Body>
                  <Card.Title>Our Impact</Card.Title>
                  <Card.Text>
                    Since its inception, HDSI Foundation has impacted thousands of lives through various
                    initiatives. We have provided scholarships, built healthcare facilities, supported digital
                    literacy programs, and enabled many communities to thrive. Our collaborations with leading
                    organizations ensure that our programs are effective and scalable.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          </Row>
        </Container>
      </section>

      {/* Footer Section */}
      <footer className="footer-section">
        <div className="container">
          <p>Contact Us: info@HDSIfoundation.org</p>
          <p>&copy; 2025 HDSI Foundation. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default AboutUs;
